properties.remarque:
Donnez une nouvelle vie à vos livres en les partageant !
empruntez, déposez, lisez, conservez ou rapportez un livre dans cette boîte.
règlement:
la boîte à livres est destinée aux adultes et aux enfants ;
les livres pour enfants sont déposés en bas de la boîte ;
les livres déposés doivent être en bon état ;
ne pas déposer plus de 5 livres ;
si la boîte est pleine, ne pas déposer de livres à ses abords ;
il est de la responsabilité de chacun de veiller à l?état et à la nature des ouvrages déposés ;
tout ouvrage à caractère religieux, prosélyte, raciste ou pornographique sera retiré ;
pensez à bien refermer la porte.
la boîte à livres est fabriquée et mise en place par les conseillers municipaux enfants en partenariat avec l?école calmette, les membres de l?apjc, les accueils de loisirs calmette et jaurès et les services municipaux.
bonne lecture !
